/***************************************************************************
Inits
***************************************************************************/

void PORTD_Init(){
  unsigned long volatile delay;
  SYSCTL_RCGC2_R |= SYSCTL_RCGC2_GPIOD; // (a) activate clock for port D
  delay = SYSCTL_RCGC2_R;
  GPIO_PORTD_LOCK_R   = GPIO_LOCK_KEY;  // unlock GPIO Port D
  GPIO_PORTD_CR_R     =  0x01;          // allow change to PD0
  GPIO_PORTD_DIR_R   &= ~0x01;          // output PD0
  GPIO_PORTD_AFSEL_R &= ~0x01;          // disable function select PD0
  GPIO_PORTD_DEN_R   |=  0x01;          // enable PD0
  GPIO_PORTD_PCTL_R  &= ~0x0000000F;    // disable port control PD0
  GPIO_PORTD_AMSEL_R &= ~0x01;          // disable analog mode select PD0
}

// SysTick Init, period will be loaded such that the interrupts happen
// at 1ms intervals.
void SysTick_Init(unsigned long period) {
    NVIC_ST_CTRL_R = 0;         // disable SysTick during setup
    NVIC_ST_RELOAD_R = period-1;// reload value
    NVIC_ST_CURRENT_R = 0;      // any write to current clears it
    NVIC_SYS_PRI3_R = (NVIC_SYS_PRI3_R&0x00FFFFFF)|0xC0000000; // priority 6
    // enable SysTick with core clock and interrupts
    NVIC_ST_CTRL_R = NVIC_ST_CTRL_ENABLE+NVIC_ST_CTRL_CLK_SRC+NVIC_ST_CTRL_INTEN;
}

/***************************************************************************
Interrupts, ISRs

***************************************************************************/
unsigned long SAMPLE=0;
unsigned long ERROR=0;
unsigned char cur_IR=0, pre_IR=0;
unsigned char Got_IR=0;
unsigned int  IR_current_time=0;
unsigned int  ERROR_PER=0;
unsigned char SIGNAL_VALID=0;
unsigned long delay=0;
void SysTick_Handler(void){

    if(Got_IR){

        SAMPLE++;
        if( IR_IN == HIGH && (         // Signal suppose to be at LOW state
            (IR_current_time < 80) ||
            (IR_current_time >=120 && IR_current_time <160) ||
            (IR_current_time >=180 && IR_current_time <200) ||
            (IR_current_time >=220 && IR_current_time <260) ||
            (IR_current_time >=280 && IR_current_time <300) ||
            (IR_current_time >=320 && IR_current_time <360) ||
            (IR_current_time >=380 && IR_current_time <400)
            )
          ) { ERROR++; }
        else if( IR_IN == LOW && (     // Signal suppose to be at HIGH state
            (IR_current_time >= 80 && IR_current_time <120) ||
            (IR_current_time >=160 && IR_current_time <180) ||
            (IR_current_time >=200 && IR_current_time <220) ||
            (IR_current_time >=260 && IR_current_time <280) ||
            (IR_current_time >=300 && IR_current_time <320) ||
            (IR_current_time >=360 && IR_current_time <380) ||
            (IR_current_time >=400 && IR_current_time <420)
            )
          ) { ERROR++; }
        else if(IR_current_time >= 420){ // finish a frame of signal
            Got_IR = 0;
            ERROR_PER = ERROR*100/SAMPLE;

            if(ERROR_PER < 10){
                SIGNAL_VALID = HIGH;
                UART0_OutString("Error is less than 10% : ");
                UART0_OutUDec(ERROR_PER);
                UART0_OutString("%\r\nError\t: ");
                UART0_OutUDec(ERROR);
                UART0_OutString("\r\nSamples\t: ");
                UART0_OutUDec(SAMPLE);
                UART0_OutString("\r\n...Valid Signal...\r\n");
            }
            else if(ERROR >= 10){
                SIGNAL_VALID = LOW;
                UART0_OutString("Error is greater than 10% : ");
                UART0_OutUDec(ERROR_PER);
                UART0_OutString("%\r\nError\t: ");
                UART0_OutUDec(ERROR);
                UART0_OutString("\r\nSamples\t: ");
                UART0_OutUDec(SAMPLE);
                UART0_OutString("\r\n...Invalid Signal...\r\n");
            }
            ERROR=0;
            ERROR_PER=0;
            SAMPLE=0;
        }


    }
    else{
        // Negative edge detection
        // if current signal is high
        // and previous signal is low,
        // then it is the rising edge of IR signal
        cur_IR = IR_IN;
        if(pre_IR & (cur_IR^0x01) && IR_current_time >= 420) {
            Got_IR = 1;
            SAMPLE = 0;
            pre_IR = cur_IR;
            IR_current_time = 0;
            UART0_OutString("\n\r");
        }
        else  pre_IR = cur_IR;

    }

    IR_current_time++;
    delay = (delay+1)%286; //140Hz

}

int main(void){
    unsigned char draw=0;
    unsigned char x=0,y=0;
    unsigned long color=0;
    PLL_Init();               // bus clock at 50 MHz
    UART0_Init();
    PORTD_Init();             // IR signal digital input
    SysTick_Init(1250);       // Systick Interrupt every 25us (40KHz for receiving IR signal)
    Output_Init();
    UART0_OutString(">> Welcome to Serial Terminal for IR Receiver side\r\n");


    ST7735_FillScreen(0x0000);
    ST7735_DrawBitmap(0, 156, Aim, 96, 128);

    while(1){

        if(delay==0){
            if(SIGNAL_VALID == HIGH){ // got the signal

                if(draw==0){
                    Output_Clear();
                    draw=1;
                    x=34;
                    y=62;
                    color=0x00;
                }
                else{
                    color=(color+100)%0xFFFF;
                    ST7735_FillScreen(color);
                    ST7735_DrawCharS( x+ 24, y,  'G', 0xFFFF-color, color, 2); //ST7735_RED
                    ST7735_DrawCharS( x+ 36, y,  'O', 0xFFFF-color, color, 2);
                    ST7735_DrawCharS( x+ 48, y,  'T', 0xFFFF-color, color, 2);
                    ST7735_DrawCharS( x+  0, y+24,  'S', 0xFFFF-color, color, 2);
                    ST7735_DrawCharS( x+ 12, y+24,  'I', 0xFFFF-color, color, 2);
                    ST7735_DrawCharS( x+ 24, y+24,  'G', 0xFFFF-color, color, 2);
                    ST7735_DrawCharS( x+ 36, y+24,  'N', 0xFFFF-color, color, 2);
                    ST7735_DrawCharS( x+ 48, y+24,  'A', 0xFFFF-color, color, 2);
                    ST7735_DrawCharS( x+ 60, y+24,  'L', 0xFFFF-color, color, 2);
                }


            }
            else if(SIGNAL_VALID == LOW && draw == 1){
                draw = 0;
                Output_Clear();
                ST7735_DrawBitmap(0, 156, Aim, 96, 128);
            }
            else{ // Waiting for signal
                ST7735_FillRect(0,0,1+x,30,ST7735_Color565(0,0,0));
                ST7735_DrawCharS( 2+x,  2, 'W', ST7735_Color565(255, 0, (0+x)%255), 0, 1);
                ST7735_DrawCharS(10+x,  2, 'a', ST7735_Color565(255, (128+x)%255, 0), 0, 1);
                ST7735_DrawCharS(18+x,  2, 'i', ST7735_Color565((255+x)%255, 255, 0), 0, 1);
                ST7735_DrawCharS(26+x,  2, 'T', ST7735_Color565(128, (255+x)%255, 0), 0, 1);
                ST7735_DrawCharS(34+x,  2, 'i', ST7735_Color565((255+x)%255, 128, 128), 0, 1);
                ST7735_DrawCharS(42+x,  2, 'n', ST7735_Color565(255, 0, (0+x)%255), 0, 1);
                ST7735_DrawCharS(50+x,  2, 'G', ST7735_Color565(255, (0+x)%255, 128), 0, 1);
                ST7735_FillRect(18,12,x,8,ST7735_Color565(0,0,0));
                ST7735_DrawCharS(18+x, 12, 'F', ST7735_Color565(255, 255, (0+x)%255), 0, 1);
                ST7735_DrawCharS(26+x, 12, 'o', ST7735_Color565(128, (255+x)%255, 0), 0, 1);
                ST7735_DrawCharS(34+x, 12, 'R', ST7735_Color565((0+x)%255, 255, 0), 0, 1);
                ST7735_DrawCharS( 2+x, 22, 'S', ST7735_Color565(0, (255+x)%255, 255), 0, 1);
                ST7735_DrawCharS(10+x, 22, 'i', ST7735_Color565((128+x)%255, 0, 255), 0, 1);
                ST7735_DrawCharS(18+x, 22, 'G', ST7735_Color565(255, (0+x)%255, 255), 0, 1);
                ST7735_DrawCharS(26+x, 22, 'N', ST7735_Color565((255+x)%255, 255, 255), 0, 1);
                ST7735_DrawCharS(34+x, 22, 'a', ST7735_Color565(255, 128, (128+x)%255), 0, 1);
                ST7735_DrawCharS(42+x, 22, 'L', ST7735_Color565(255, (128+x)%255, 0), 0, 1);
                x = (x+2)%128;

            }
        }
    }
}



